INSERT INTO "public"."sys_resource" VALUES ('dc0542168546021e17149ebef010c1fd', '刘永君与刘金鱼买卖合同纠纷二审民事判决书', '<p class="ql-align-justify">	上诉人（原审被告）：<span style="color: rgb(0, 0, 0);">刘永君，男，1975年5月28日出生，汉族，职工，</span>。</p><p class="ql-align-justify">	委托诉讼代理人：<span style="color: rgb(0, 0, 0);">乔艳，女，1978年7月23日出生，汉族，职工</span>。</p><p class="ql-align-justify">	委托诉讼代理人：刘莉，陕西渭临律师事务所律师。</p><p class="ql-align-justify">	被上诉人（原审原告）：<span style="color: rgb(0, 0, 0);">刘金鱼，男，1962年4月23日出生，汉族，农民</span>。</p><p class="ql-align-justify">	委托诉讼代理人：<span style="color: rgb(0, 0, 0);">魏建录，男，1958年4月18日出生，汉族，司法局干部</span>。</p><p class="ql-align-justify">	上诉人刘永君因与被上诉人刘金鱼买卖合同纠纷一案，不服陕西省渭南市华州区人民法院（2016）陕0503民初353号民事判决，向本院提起上诉。本院于2019年9月9日立案受理后，依法组成合议庭对本案进行了审理。上诉人刘永君及其委托诉讼代理人刘莉、乔艳，被上诉人刘金鱼及其委托诉讼代理人魏建录到庭参加了诉讼。本案现已审理终结。</p><p class="ql-align-justify">	刘永君向本院提出的上诉请求：1、撤销陕西省渭南市华州区人民法院（2016）陕0503民初353号民事判决；2、改判驳回被上诉人的诉讼请求；3、一、二审案件诉讼费由被上诉人负担。事实与理由：原审判决认定事实不清，判处错误。上诉人在一审提交了上诉人砖厂2012年全年开具的煤灰票本（收料凭证）、砖厂会计和出纳分别做的记账本，证明在2012年被上诉人全年送煤灰共25车。被上诉人承认在2012年8月12日后以拉砖抵账、领取现金方式收到了上诉人款项共计38512元，虽辩称不是25车煤灰款，但是2011年的煤灰款已经结清，双方对此已无争议。而2012年全年被上诉人除给上诉人送25车煤灰再无其他，被上诉人从上诉人处领到的这38512元就是这25车煤灰款。上诉人提供的系列证据之间相互印证，足以证明25车煤灰款已经结清。</p><p class="ql-align-justify">	被上诉人刘金鱼辩称，被上诉人给上诉人送煤灰，上诉人收到煤灰后开具收据，结账后收回煤灰票收据，还有25车煤灰收据没有结账。被上诉人所收的38512元与25车煤灰无关。上诉理由不能成立。</p><p class="ql-align-justify">	刘金鱼向一审法院提出诉讼请求：1、判令被告归还原告货款41250元，并按银行贷款利率支付利息；2、诉讼费由被告承担。</p><p class="ql-align-justify">	一审法院查明事实：2011年元月起至2012年10月25日止，原告向被告经营的高楼永鑫砖厂拉送煤灰，每次被告砖厂工作人员向原告出具收据，原告用收据向被告结算。2012年6月27日之前结清了2011年煤灰款，现原告持2012年8月8日至2012年10月25日被告砖厂所开拉送煤灰25车收据向被告主张权利。审理中，原告认可其于2012年8月12日后以拉砖抵账、领取现金收到被告款项共计38512元，但认为非25车煤灰款。另查明，原告在2012年期间每车煤灰款为1650元。</p><p class="ql-align-justify">	一审法院认为，原、被告对拉煤灰凭票结算交易习惯不持异议，双方结算后，由被告出具的煤灰票应由被告收回，被告及其证人均说明因结算时原告未拿煤灰票，其给原告出具了欠条来表明25车煤灰款已结算，但在一审、二审及重审中，被告均未提供出该欠条来对抗原告持有的票据，被告辩称已通过以砖抵账、给付现金等方式给付了原告25车煤灰款，原告认可收到被告款项，但认为非25车煤灰款，被告辩称该25车煤灰款已结清的辩解无证据支持，故对被告的辩解理由不予采信。根据双方的结算习惯，现原告持有票据向被告主张权利，并无不当，故对原告要求被告归还煤灰款的请求予以支持。对原告主张的利息请求，因双方无约定，原告也未提供损失的证据，故不予支持。对被告持有的对原告的债权凭证，被告可另案起诉。据此，一审法院判决：一、被告刘永君于本判决生效后10日内归还原告刘金鱼煤灰款41250元。二、驳回原告刘金鱼其他诉讼请求。 案件受理费831元，由被告刘永君承担。</p><p class="ql-align-justify">	二审审理中，双方当事人均未提供新证据。</p><p class="ql-align-justify">	二审经审理查明：原审查明事实属实，本院予以确认。</p><p class="ql-align-justify">	本院认为，被上诉人刘金鱼给上诉人刘永君经营的高楼永鑫砖厂拉送煤灰，二者形成买卖合同关系。双方均认可2012年6月已结清2011年的煤灰款。本案双方主要争议焦点问题是被上诉人2012年8月2日以后所送的25车煤灰款是否结清。上诉人出具2012年8月6日后被上诉人陆续拉砖抵账或者领款条据共计38512元，认为就是支付该25车煤灰款。被上诉人刘金鱼对2012年8月6日后领款或拉砖顶账38512元的事实认可，但是认为是支付的其他款项，与本案的25车煤灰款无关。但对此，被上诉人刘金鱼并未提供证据证明，根据《最高人民法院&lt;关于民事诉讼证据的若干规定&gt;》第二条“当事人对自己提出的诉讼请求所依据的事实或者反驳对方诉讼请求所依据的事实有责任提供证据加以证明。没有证据或者证据不足以证明当事人的事实主张的，由负有举证责任的当事人承担不利后果。”，其应承担举证不能的法律后果。</p><p class="ql-align-justify">	被上诉人提供砖厂原会计<span style="color: rgb(0, 0, 0);">王某某</span>证言，证明2012年8月8日至10月28日煤灰款未结，但是，根据上诉人提供的记账单，<span style="color: rgb(0, 0, 0);">王某某</span>于2013年元月19日记账中载明25车煤灰已付了部分款项，下欠22518元（二审庭后与<span style="color: rgb(0, 0, 0);">王某某</span>核实属实），该账册记载内容与其证言内容相互矛盾。被上诉人提供的刘美萍的证言与刘美萍原二审出庭证言相互矛盾，故被上诉人提供的<span style="color: rgb(0, 0, 0);">王某某</span>和刘美萍的证言不予采信。上诉人提供了其2012年完整的“发砖票”本（实际上是砖厂出具的煤灰票收料本），证明2012年被上诉人刘金鱼给上诉人砖厂共计送了25车煤灰。被上诉人认为其在2012年除该25车未结账外还送过其他煤灰，但未提供证据证明。故上诉人认为其已经部分结清该25车煤灰款的上诉理由成立。</p><p><br></p>', '2019-12-19 23:01:05.53', '2019-12-19 23:01:05.53', '1', '渭南市人民法院', '775212abf5f806545b5efda9bb63db24', '', '雷谋', '', '', '8829b7a34857b5a1fefa5300e9ce6489', '2019-12-19 23:01:05.533', '1');
INSERT INTO "public"."sys_resource" VALUES ('fa2389c496abd476798f5ee736a6ea68', '中华人民共和国密码法', '<p><strong>目录</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第一章 总则</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二章 核心密码、普通密码</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三章 商用密码</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第四章 法律责任</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第五章 附则</p><p>&nbsp;<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第一章 总则</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第一条 为了规范密码应用和管理，促进密码事业发展，保障网络与信息安全，维护国家安全和社会公共利益，保护公民、法人和其他组织的合法权益，制定本法。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二条 本法所称密码，是指采用特定变换的方法对信息等进行加密保护、安全认证的技术、产品和服务。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三条 密码工作坚持总体国家安全观，遵循统一领导、分级负责，创新发展、服务大局，依法管理、保障安全的原则。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第四条 坚持中国共产党对密码工作的领导。中央密码工作领导机构对全国密码工作实行统一领导，制定国家密码工作重大方针政策，统筹协调国家密码重大事项和重要工作，推进国家密码法治建设。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第五条 国家密码管理部门负责管理全国的密码工作。县级以上地方各级密码管理部门负责管理本行政区域的密码工作。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;国家机关和涉及密码工作的单位在其职责范围内负责本机关、本单位或者本系统的密码工作。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第六条 国家对密码实行分类管理。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;密码分为核心密码、普通密码和商用密码。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第七条 核心密码、普通密码用于保护国家秘密信息，核心密码保护信息的最高密级为绝密级，普通密码保护信息的最高密级为机密级。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;核心密码、普通密码属于国家秘密。密码管理部门依照本法和有关法律、行政法规、国家有关规定对核心密码、普通密码实行严格统一管理。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第八条 商用密码用于保护不属于国家秘密的信息。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;公民、法人和其他组织可以依法使用商用密码保护网络与信息安全。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第九条 国家鼓励和支持密码科学技术研究和应用，依法保护密码领域的知识产权，促进密码科学技术进步和创新。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;国家加强密码人才培养和队伍建设，对在密码工作中作出突出贡献的组织和个人，按照国家有关规定给予表彰和奖励。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十条 国家采取多种形式加强密码安全教育，将密码安全教育纳入国民教育体系和公务员教育培训体系，增强公民、法人和其他组织的密码安全意识。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十一条 县级以上人民政府应当将密码工作纳入本级国民经济和社会发展规划，所需经费列入本级财政预算。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十二条 任何组织或者个人不得窃取他人加密保护的信息或者非法侵入他人的密码保障系统。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;任何组织或者个人不得利用密码从事危害国家安全、社会公共利益、他人合法权益等违法犯罪活动。</p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二章 核心密码、普通密码</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十三条 国家加强核心密码、普通密码的科学规划、管理和使用，加强制度建设，完善管理措施，增强密码安全保障能力。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十四条 在有线、无线通信中传递的国家秘密信息，以及存储、处理国家秘密信息的信息系统，应当依照法律、行政法规和国家有关规定使用核心密码、普通密码进行加密保护、安全认证。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十五条 从事核心密码、普通密码科研、生产、服务、检测、装备、使用和销毁等工作的机构（以下统称密码工作机构）应当按照法律、行政法规、国家有关规定以及核心密码、普通密码标准的要求，建立健全安全管理制度，采取严格的保密措施和保密责任制，确保核心密码、普通密码的安全。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十六条 密码管理部门依法对密码工作机构的核心密码、普通密码工作进行指导、监督和检查，密码工作机构应当配合。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十七条 密码管理部门根据工作需要会同有关部门建立核心密码、普通密码的安全监测预警、安全风险评估、信息通报、重大事项会商和应急处置等协作机制，确保核心密码、普通密码安全管理的协同联动和有序高效。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;密码工作机构发现核心密码、普通密码泄密或者影响核心密码、普通密码安全的重大问题、风险隐患的，应当立即采取应对措施，并及时向保密行政管理部门、密码管理部门报告，由保密行政管理部门、密码管理部门会同有关部门组织开展调查、处置，并指导有关密码工作机构及时消除安全隐患。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十八条 国家加强密码工作机构建设，保障其履行工作职责。</p><p>国家建立适应核心密码、普通密码工作需要的人员录用、选调、保密、考核、培训、待遇、奖惩、交流、退出等管理制度。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第十九条 密码管理部门因工作需要，按照国家有关规定，可以提请公安、交通运输、海关等部门对核心密码、普通密码有关物品和人员提供免检等便利，有关部门应当予以协助。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十条 密码管理部门和密码工作机构应当建立健全严格的监督和安全审查制度，对其工作人员遵守法律和纪律等情况进行监督，并依法采取必要措施，定期或者不定期组织开展安全审查。</p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三章 商用密码</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十一条 国家鼓励商用密码技术的研究开发、学术交流、成果转化和推广应用，健全统一、开放、竞争、有序的商用密码市场体系，鼓励和促进商用密码产业发展。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;各级人民政府及其有关部门应当遵循非歧视原则，依法平等对待包括外商投资企业在内的商用密码科研、生产、销售、服务、进出口等单位（以下统称商用密码从业单位）。国家鼓励在外商投资过程中基于自愿原则和商业规则开展商用密码技术合作。行政机关及其工作人员不得利用行政手段强制转让商用密码技术。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;商用密码的科研、生产、销售、服务和进出口，不得损害国家安全、社会公共利益或者他人合法权益。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十二条 国家建立和完善商用密码标准体系。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;国务院标准化行政主管部门和国家密码管理部门依据各自职责，组织制定商用密码国家标准、行业标准。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;国家支持社会团体、企业利用自主创新技术制定高于国家标准、行业标准相关技术要求的商用密码团体标准、企业标准。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十三条 国家推动参与商用密码国际标准化活动，参与制定商用密码国际标准，推进商用密码中国标准与国外标准之间的转化运用。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;国家鼓励企业、社会团体和教育、科研机构等参与商用密码国际标准化活动。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十四条 商用密码从业单位开展商用密码活动，应当符合有关法律、行政法规、商用密码强制性国家标准以及该从业单位公开标准的技术要求。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;国家鼓励商用密码从业单位采用商用密码推荐性国家标准、行业标准，提升商用密码的防护能力，维护用户的合法权益。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十五条 国家推进商用密码检测认证体系建设，制定商用密码检测认证技术规范、规则，鼓励商用密码从业单位自愿接受商用密码检测认证，提升市场竞争力。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;商用密码检测、认证机构应当依法取得相关资质，并依照法律、行政法规的规定和商用密码检测认证技术规范、规则开展商用密码检测认证。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;商用密码检测、认证机构应当对其在商用密码检测认证中所知悉的国家秘密和商业秘密承担保密义务。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十六条 涉及国家安全、国计民生、社会公共利益的商用密码产品，应当依法列入网络关键设备和网络安全专用产品目录，由具备资格的机构检测认证合格后，方可销售或者提供。商用密码产品检测认证适用《中华人民共和国网络安全法》的有关规定，避免重复检测认证。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;商用密码服务使用网络关键设备和网络安全专用产品的，应当经商用密码认证机构对该商用密码服务认证合格。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十七条 法律、行政法规和国家有关规定要求使用商用密码进行保护的关键信息基础设施，其运营者应当使用商用密码进行保护，自行或者委托商用密码检测机构开展商用密码应用安全性评估。商用密码应用安全性评估应当与关键信息基础设施安全检测评估、网络安全等级测评制度相衔接，避免重复评估、测评。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关键信息基础设施的运营者采购涉及商用密码的网络产品和服务，可能影响国家安全的，应当按照《中华人民共和国网络安全法》的规定，通过国家网信部门会同国家密码管理部门等有关部门组织的国家安全审查。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十八条 国务院商务主管部门、国家密码管理部门依法对涉及国家安全、社会公共利益且具有加密保护功能的商用密码实施进口许可，对涉及国家安全、社会公共利益或者中国承担国际义务的商用密码实施出口管制。商用密码进口许可清单和出口管制清单由国务院商务主管部门会同国家密码管理部门和海关总署制定并公布。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;大众消费类产品所采用的商用密码不实行进口许可和出口管制制度。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第二十九条 国家密码管理部门对采用商用密码技术从事电子政务电子认证服务的机构进行认定，会同有关部门负责政务活动中使用电子签名、数据电文的管理。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三十条 商用密码领域的行业协会等组织依照法律、行政法规及其章程的规定，为商用密码从业单位提供信息、技术、培训等服务，引导和督促商用密码从业单位依法开展商用密码活动，加强行业自律，推动行业诚信建设，促进行业健康发展。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三十一条 密码管理部门和有关部门建立日常监管和随机抽查相结合的商用密码事中事后监管制度，建立统一的商用密码监督管理信息平台，推进事中事后监管与社会信用体系相衔接，强化商用密码从业单位自律和社会监督。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;密码管理部门和有关部门及其工作人员不得要求商用密码从业单位和商用密码检测、认证机构向其披露源代码等密码相关专有信息，并对其在履行职责中知悉的商业秘密和个人隐私严格保密，不得泄露或者非法向他人提供。</p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第四章 法律责任</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三十二条 违反本法第十二条规定，窃取他人加密保护的信息，非法侵入他人的密码保障系统，或者利用密码从事危害国家安全、社会公共利益、他人合法权益等违法活动的，由有关部门依照《中华人民共和国网络安全法》和其他有关法律、行政法规的规定追究法律责任。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三十三条 违反本法第十四条规定，未按照要求使用核心密码、普通密码的，由密码管理部门责令改正或者停止违法行为，给予警告；情节严重的，由密码管理部门建议有关国家机关、单位对直接负责的主管人员和其他直接责任人员依法给予处分或者处理。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三十四条 违反本法规定，发生核心密码、普通密码泄密案件的，由保密行政管理部门、密码管理部门建议有关国家机关、单位对直接负责的主管人员和其他直接责任人员依法给予处分或者处理。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;违反本法第十七条第二款规定，发现核心密码、普通密码泄密或者影响核心密码、普通密码安全的重大问题、风险隐患，未立即采取应对措施，或者未及时报告的，由保密行政管理部门、密码管理部门建议有关国家机关、单位对直接负责的主管人员和其他直接责任人员依法给予处分或者处理。</p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;第三十五条 商用密码检测、认证机构违反本法第二十五条第二款、第三款规定开展商用密码检测认证的，由市场监督管理部门会同密码管理部门责令改正或者停止违法行为，给予警告，没收违法所得；违法所得三十万元以上的，可以并处违法所得一倍以上三倍以下罚款；没有违法所得或者违法所得不足三十万元的，可以并处十万元以上三十万元以下罚款；情节严重的，依法吊销相关资质。</span></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三十六条 违反本法第二十六条规定，销售或者提供未经检测认证或者检测认证不合格的商用密码产品，或者提供未经认证或者认证不合格的商用密码服务的，由市场监督管理部门会同密码管理部门责令改正或者停止违法行为，给予警告，没收违法产品和违法所得；违法所得十万元以上的，可以并处违法所得一倍以上三倍以下罚款；没有违法所得或者违法所得不足十万元的，可以并处三万元以上十万元以下罚款。</span></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三十七条 关键信息基础设施的运营者违反本法第二十七条第一款规定，未按照要求使用商用密码，或者未按照要求开展商用密码应用安全性评估的，由密码管理部门责令改正，给予警告；拒不改正或者导致危害网络安全等后果的，处十万元以上一百万元以下罚款，对直接负责的主管人员处一万元以上十万元以下罚款。</span></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关键信息基础设施的运营者违反本法第二十七条第二款规定，使用未经安全审查或者安全审查未通过的产品或者服务的，由有关主管部门责令停止使用，处采购金额一倍以上十倍以下罚款；对直接负责的主管人员和其他直接责任人员处一万元以上十万元以下罚款。</span></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三十八条 违反本法第二十八条实施进口许可、出口管制的规定，进出口商用密码的，由国务院商务主管部门或者海关依法予以处罚。</span></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第三十九条 违反本法第二十九条规定，未经认定从事电子政务电子认证服务的，由密码管理部门责令改正或者停止违法行为，给予警告，没收违法产品和违法所得；违法所得三十万元以上的，可以并处违法所得一倍以上三倍以下罚款；没有违法所得或者违法所得不足三十万元的，可以并处十万元以上三十万元以下罚款。</span></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第四十条 密码管理部门和有关部门、单位的工作人员在密码工作中滥用职权、玩忽职守、徇私舞弊，或者泄露、非法向他人提供在履行职责中知悉的商业秘密和个人隐私的，依法给予处分。</span></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第四十一条 违反本法规定，构成犯罪的，依法追究刑事责任；给他人造成损害的，依法承担民事责任。</span></p><p><strong style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第五章 附则</strong></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第四十二条 国家密码管理部门依照法律、行政法规的规定，制定密码管理规章。</span></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第四十三条 中国人民解放军和中国人民武装警察部队的密码工作管理办法，由中央军事委员会根据本法制定。</span></p><p><span style="color: rgb(36, 36, 36);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;第四十四条 本法自2020年1月1日起施行。</span></p>', '2019-12-20 01:51:36.955', '2019-12-20 01:51:36.955', '1', '陕西高级人民法院', '610000', '', '雷子锐', '', '', '542a4629168946c5df150f99936985a4', '2019-12-20 01:51:37.116', '1');
INSERT INTO "public"."sys_resource" VALUES ('ce96a83a6fc37c4a10211590fd7c8f3e', '最高人民法院关于印发《全国法院民商事审判工作会议纪要》的', '<p>	各省、自治区、直辖市高级人民法院，解放军军事法院，新疆维吾尔自治区高级人民法院生产建设兵团分院：</p><p>	《全国法院民商事审判工作会议纪要》（以下简称《会议纪要》）已于2019年9月11日经最高人民法院审判委员会民事行政专业委员会第319次会议原则通过。为便于进一步学习领会和正确适用《会议纪要》，特作如下通知：</p><p>	一、充分认识《会议纪要》出台的意义</p><p>	《会议纪要》针对民商事审判中的前沿疑难争议问题，在广泛征求各方面意见的基础上，经最高人民法院审判委员会民事行政专业委员会讨论决定。《会议纪要》的出台，对统一裁判思路，规范法官自由裁量权，增强民商事审判的公开性、透明度以及可预期性，提高司法公信力具有重要意义。各级人民法院要正确把握和理解适用《会议纪要》的精神实质和基本内容。</p><p>	二、及时组织学习培训</p><p>	为使各级人民法院尽快准确理解掌握《会议纪要》的内涵，在案件审理中正确理解适用，各级人民法院要在妥善处理好工学关系的前提下，通过多种形式组织学习培训，做好宣传工作。</p><p>	三、准确把握《会议纪要》的应用范围</p><p>	纪要不是司法解释，不能作为裁判依据进行援引。《会议纪要》发布后，人民法院尚未审结的一审、二审案件，在裁判文书“本院认为”部分具体分析法律适用的理由时，可以根据《会议纪要》的相关规定进行说理。</p><p>	对于适用中存在的问题,请层报最高人民法院。</p>', '2019-12-20 01:54:06.909', '2019-12-20 01:54:06.909', '1', '陕西高级人民法院', '610000', '', '雷子锐', '', '', '542a4629168946c5df150f99936985a4', '2019-12-20 01:54:07.065', '1');
INSERT INTO "public"."sys_resource" VALUES ('895cab055a9b57f1fc6e29d96ce16997', '中华人民共和国资源税法', '<p>第一条 在中华人民共和国领域和中华人民共和国管辖的其他海域开发应税资源的单位和个人，为资源税的纳税人，应当依照本法规定缴纳资源税。</p><p>应税资源的具体范围，由本法所附《资源税税目税率表》（以下称《税目税率表》）确定。</p><p>第二条 资源税的税目、税率，依照《税目税率表》执行。</p><p>《税目税率表》中规定实行幅度税率的，其具体适用税率由省、自治区、直辖市人民政府统筹考虑该应税资源的品位、开采条件以及对生态环境的影响等情况，在《税目税率表》规定的税率幅度内提出，报同级人民代表大会常务委员会决定，并报全国人民代表大会常务委员会和国务院备案。《税目税率表》中规定征税对象为原矿或者选矿的，应当分别确定具体适用税率。</p><p>第三条 资源税按照《税目税率表》实行从价计征或者从量计征。</p><p>《税目税率表》中规定可以选择实行从价计征或者从量计征的，具体计征方式由省、自治区、直辖市人民政府提出，报同级人民代表大会常务委员会决定，并报全国人民代表大会常务委员会和国务院备案。</p><p>实行从价计征的，应纳税额按照应税资源产品（以下称应税产品）的销售额乘以具体适用税率计算。实行从量计征的，应纳税额按照应税产品的销售数量乘以具体适用税率计算。</p><p>应税产品为矿产品的，包括原矿和选矿产品。</p><p>第四条 纳税人开采或者生产不同税目应税产品的，应当分别核算不同税目应税产品的销售额或者销售数量；未分别核算或者不能准确提供不同税目应税产品的销售额或者销售数量的，从高适用税率。</p><p>第五条 纳税人开采或者生产应税产品自用的，应当依照本法规定缴纳资源税；但是，自用于连续生产应税产品的，不缴纳资源税。</p><p>第六条 有下列情形之一的，免征资源税：</p><p>（一）开采原油以及在油田范围内运输原油过程中用于加热的原油、天然气；</p><p>（二）煤炭开采企业因安全生产需要抽采的煤成（层）气。</p><p>有下列情形之一的，减征资源税：</p><p>（一）从低丰度油气田开采的原油、天然气，减征百分之二十资源税；</p><p>（二）高含硫天然气、三次采油和从深水油气田开采的原油、天然气，减征百分之三十资源税；</p><p>（三）稠油、高凝油减征百分之四十资源税；</p><p>（四）从衰竭期矿山开采的矿产品，减征百分之三十资源税。</p><p>根据国民经济和社会发展需要，国务院对有利于促进资源节约集约利用、保护环境等情形可以规定免征或者减征资源税，报全国人民代表大会常务委员会备案。</p><p>第七条 有下列情形之一的，省、自治区、直辖市可以决定免征或者减征资源税：</p><p>（一）纳税人开采或者生产应税产品过程中，因意外事故或者自然灾害等原因遭受重大损失；</p><p>（二）纳税人开采共伴生矿、低品位矿、尾矿。</p><p>前款规定的免征或者减征资源税的具体办法，由省、自治区、直辖市人民政府提出，报同级人民代表大会常务委员会决定，并报全国人民代表大会常务委员会和国务院备案。</p><p>第八条 纳税人的免税、减税项目，应当单独核算销售额或者销售数量；未单独核算或者不能准确提供销售额或者销售数量的，不予免税或者减税。</p><p>第九条 资源税由税务机关依照本法和《中华人民共和国税收征收管理法》的规定征收管理。</p><p>税务机关与自然资源等相关部门应当建立工作配合机制，加强资源税征收管理。</p><p>第十条 纳税人销售应税产品，纳税义务发生时间为收讫销售款或者取得索取销售款凭据的当日；自用应税产品的，纳税义务发生时间为移送应税产品的当日。</p><p>第十一条 纳税人应当向应税产品开采地或者生产地的税务机关申报缴纳资源税。</p><p>第十二条 资源税按月或者按季申报缴纳；不能按固定期限计算缴纳的，可以按次申报缴纳。</p><p>纳税人按月或者按季申报缴纳的，应当自月度或者季度终了之日起十五日内，向税务机关办理纳税申报并缴纳税款；按次申报缴纳的，应当自纳税义务发生之日起十五日内，向税务机关办理纳税申报并缴纳税款。</p><p>第十三条 纳税人、税务机关及其工作人员违反本法规定的，依照《中华人民共和国税收征收管理法》和有关法律法规的规定追究法律责任。</p><p>第十四条 国务院根据国民经济和社会发展需要，依照本法的原则，对取用地表水或者地下水的单位和个人试点征收水资源税。征收水资源税的，停止征收水资源费。</p><p>水资源税根据当地水资源状况、取用水类型和经济发展等情况实行差别税率。</p><p>水资源税试点实施办法由国务院规定，报全国人民代表大会常务委员会备案。</p><p>国务院自本法施行之日起五年内，就征收水资源税试点情况向全国人民代表大会常务委员会报告，并及时提出修改法律的建议。</p><p>第十五条 中外合作开采陆上、海上石油资源的企业依法缴纳资源税。</p><p>2011年11月1日前已依法订立中外合作开采陆上、海上石油资源合同的，在该合同有效期内，继续依照国家有关规定缴纳矿区使用费，不缴纳资源税；合同期满后，依法缴纳资源税。</p><p>第十六条 本法下列用语的含义是：</p><p>（一）低丰度油气田，包括陆上低丰度油田、陆上低丰度气田、海上低丰度油田、海上低丰度气田。陆上低丰度油田是指每平方公里原油可开采储量丰度低于二十五万立方米的油田；陆上低丰度气田是指每平方公里天然气可开采储量丰度低于二亿五千万立方米的气田；海上低丰度油田是指每平方公里原油可开采储量丰度低于六十万立方米的油田；海上低丰度气田是指每平方公里天然气可开采储量丰度低于六亿立方米的气田。</p><p>（二）高含硫天然气，是指硫化氢含量在每立方米三十克以上的天然气。</p><p>（三）三次采油，是指二次采油后继续以聚合物驱、复合驱、泡沫驱、气水交替驱、二氧化碳驱、微生物驱等方式进行采油。</p><p>（四）深水油气田，是指水深超过三百米的油气田。</p><p>（五）稠油，是指地层原油粘度大于或等于每秒五十毫帕或原油密度大于或等于每立方厘米零点九二克的原油。</p><p>（六）高凝油，是指凝固点高于四十摄氏度的原油。</p><p>（七）衰竭期矿山，是指设计开采年限超过十五年，且剩余可开采储量下降到原设计可开采储量的百分之二十以下或者剩余开采年限不超过五年的矿山。衰竭期矿山以开采企业下属的单个矿山为单位确定。</p><p>第十七条 本法自2020年9月1日起施行。1993年12月25日国务院发布的《中华人民共和国资源税暂行条例》同时废止。</p>', '2019-12-20 02:12:26.048', '2019-12-20 02:12:26.048', '1', '渭南市人民法院', '775212abf5f806545b5efda9bb63db24', '', '雷谋', '', '', '8829b7a34857b5a1fefa5300e9ce6489', '2019-12-20 02:12:26.195', '1');
INSERT INTO "public"."sys_resource" VALUES ('ff3f20120dff1d2c8a8a9cad8fb65967', '11', '<p>第六条 有下列情形之一的，免征资源税：</p><p>（一）开采原油以及在油田范围内运输原油过程中用于加热的原油、天然气；</p><p>（二）煤炭开采企业因安全生产需要抽采的煤成（层）气。</p><p>有下列情形之一的，减征资源税：</p><p>（一）从低丰度油气田开采的原油、天然气，减征百分之二十资源税；</p><p>（二）高含硫天然气、三次采油和从深水油气田开采的原油、天然气，减征百分之三十资源税；</p><p>（三）稠油、高凝油减征百分之四十资源税；</p><p>（四）从衰竭期矿山开采的矿产品，减征百分之三十资源税。</p><p>根据国民经济和社会发展需要，国务院对有利于促进资源节约集约利用、保护环境等情形可以规定免征或者减征资源税，报全国人民代表大会常务委员会备案。</p><p>第七条 有下列情形之一的，省、自治区、直辖市可以决定免征或者减征资源税：</p><p>（一）纳税人开采或者生产应税产品过程中，因意外事故或者自然灾害等原因遭受重大损失；</p><p>（二）纳税人开采共伴生矿、低品位矿、尾矿。</p>', '2019-12-20 02:14:09.376', '2019-12-20 02:14:09.376', '1', '渭南市人民法院', '775212abf5f806545b5efda9bb63db24', '', '雷谋', 'http://114.116.30.229/group1/M00/00/FC/wKgBol37ve6AQpJmAAAzWODdtxM56.xlsx', '企业改版开发计划_人员分工(1).xlsx', '8829b7a34857b5a1fefa5300e9ce6489', '2019-12-20 02:14:09.525', '2');
