INSERT INTO "public"."sys_resource" VALUES ('1bd7d4b16b1e54c96cba7f47ca788f8b', '我的测试下载', '<p class="ql-align-justify"><strong>宏观信息</strong></p><p class="ql-align-justify"><br></p><p class="ql-align-justify">◎<strong>国务院：</strong>发布关于进一步做好稳就业工作的意见，研究适时进一步降低进口关税和制度性成本，扩大出口信用保险覆盖面、合理降低保费，确保审核办理正常退税平均时间在10个工作日以内。</p><p class="ql-align-justify">◎<strong>财政部副部长：</strong>2019年我国实施更大规模减税降费，在确保公平、效率的情况下，有效减轻了实体经济负担。前10月实现减税降费近2万亿元，预计全年减税降费超过2万亿元，占GDP比重超过2%。</p><p class="ql-align-justify">◎<strong>央行：</strong>今日开展2019年第七期央行票据互换(CBS)操作。本期操作量为60亿元，期限3个月，面向公开市场业务一级交易商进行固定费率数量招标，费率为0.10%，首期结算日为2019年12月24日，到期日为2020年3月24日(遇节假日顺延)。</p><p class="ql-align-justify">◎<strong>任泽平：</strong>建议大幅减税降费，2020年降低企业所得税及社保缴费费率来增强企业和居民信心。从货币政策方面来看，不能因为一头猪进行货币收紧，牺牲整体国民经济，应该进行适当的降息降准。</p><p class="ql-align-justify">◎<strong>美联储观察：</strong>美联储明年1月维持利率在当前的1.50%-1.75%区间的概率为97.8%，降息25个基点的概率为0%，加息25个基点的概率为2.2%。</p><p class="ql-align-justify">◎<strong>人民币汇率</strong>：人民币兑美元中间价报7.0119，下调2点；上一交易日中间价7.0117。</p><p class="ql-align-justify">◎<strong>上海银行间同业拆放利率</strong>：隔夜shibor报1.1140%，下跌44.30个基点；7天shibor报2.4500%，下跌0.30个基点；3个月shibor报3.0335%，下跌0.65个基点。</p><p class="ql-align-justify"><strong>现货市场</strong></p><p><img src="https://pics5.baidu.com/feed/0b55b319ebc4b74561d926358a04ec128b821545.jpeg?token=1aa28ad362fe46281278d9e727e24456&amp;s=8501F51490D989801658CCD9030000BD"></p><p><img src="https://pics0.baidu.com/feed/a6efce1b9d16fdfad2792839f1777e5196ee7bca.jpeg?token=4c592c4d1f3896eee7ecafbc0b61e8df&amp;s=C905CC105E69688A5AFD94CE020050B1"></p><p class="ql-align-justify"><strong>期货股市</strong></p><p><img src="https://pics1.baidu.com/feed/32fa828ba61ea8d34d6f8de8d3f2c24b271f588f.jpeg?token=10217179a76addef5c648b5480938427&amp;s=8505F414CBB939887E9ACCC9030090BF"></p><p><img src="https://pics2.baidu.com/feed/63d9f2d3572c11df83cf4d5026df90d5f603c2a1.jpeg?token=37ea2b16446e6d35e32f02bdf71316e9&amp;s=8525FC14CFCFA4017C9AADD9030090BE"></p><p class="ql-align-justify"><strong>行业新闻</strong></p><p class="ql-align-justify">◎<strong>建材成交量：</strong>12月24日，Mysteel全国贸易商建材日成交量为12.23万吨，较上一交易日减少2.29万吨。</p><p class="ql-align-justify">◎<strong>铁矿成交量</strong>：12月24日，全国主港铁矿累计成交182万吨，环比上涨75.8%；上周平均每日成交133万吨，上月平均每日成交127.4万吨。</p><p class="ql-align-justify">◎<strong>生态环境部</strong>：12月23日京津冀地区13个城市中，4城空气质量为重度污染，1城空气质量为中度污染，3城空气质量为轻度污染，4城空气质量为良，1城空气质量为优。其中邯郸市空气质量最差，12月23日AQI指数为247；张家口空气质量最佳，12月23日AQI指数为46。</p><p class="ql-align-justify">◎<strong>长治市人民政府办公室：</strong>印发关于《长治市焦化行业压减过剩产能打好污染防治攻坚战行动实施方案》的通知。提到压减任务为：潞州区85万吨，潞城区305.4万吨，屯留区46万吨，壶关县9万吨，黎城县24万吨，襄垣县77万吨，沁源县96万吨，合计642.4万吨。</p><p class="ql-align-justify">◎<strong>陕西生态环境厅：</strong>23日，受偏东风影响，关中中西部污染有所加重。24日至25日上午，全省(陕西省)大部扩散条件不利，预计关中地区以重度污染为主。25日下午至26日，受冷空气影响，我省扩散条件将逐渐改善，预计关中地区以良至轻度污染为主。</p><p class="ql-align-justify">◎<strong>河北工信厅：</strong></p><p class="ql-align-justify">&gt;&gt;承德盛丰钢铁有限公司拟出让650m3炼铁高炉2座，50吨炼钢转炉2座，炼铁产能148.34万吨，炼钢产能152万吨。</p><p class="ql-align-justify">&gt;&gt;河北普阳钢铁有限公司拟2020年3月开工新建1580m3高炉1座，产能137万吨；140t转炉1座，产能151.67万吨。</p><p class="ql-align-justify">◎<strong>贵州能源局：</strong>公布2019年度第四十二批拟关闭退出煤矿名单，共退出产能24万吨。</p><p class="ql-align-justify">◎<strong>壶关：</strong>12月22日，山西翔天钢铁有限公司已完成1座45吨电炉拆除工作，23日经专家现场验收确认，主体设备己经拆除到位，不具备恢复生产条件。</p><p class="ql-align-justify">◎<strong>各地环保动态：</strong></p><p class="ql-align-justify">&gt;&gt;太原、临汾、运城3市近日分别调整重污染天气预警级别，预警级别由橙色调整为红色，同时启动重污染天气应急预案红色(一级)响应。</p><p class="ql-align-justify">&gt;&gt;唐山古冶区、迁安自12月23日12时起全市启动重污染天气级应急响应，解除时间另行通知。</p><p class="ql-align-justify">&gt;&gt;衡水市定于12月24日0时起升级为重污染天气红色预警启动Ⅰ级应急响应，解除时间根据会商研判结果另行通知。</p><p class="ql-align-justify">&gt;&gt;12月23日18时起，焦作市将重污染天气橙色预警(五城区建筑工地及部分企业执行红色预警管控措施)全面升级为红色(I级)预警，解除时间另行通知。</p><p class="ql-align-justify">&gt;&gt;日照市重污染天气应急指挥部决定自12月24日8时30分起解除重污染天气黄色预警，同时终止Ⅲ级应急响应。</p><p class="ql-align-justify">&gt;&gt;济源市从12月23日12时起，将12月5日0时启动的重污染天气橙色预警升级为红色预警，同时将Ⅱ级响应升级为Ⅰ级响应。</p><p class="ql-align-justify">◎<strong>郑商所：</strong>2020年1月1日(星期三)休市，1月2日(星期四)起照常开市。2019年12月31日(星期二)晚上不进行夜盘交易。</p><p class="ql-align-justify"><strong>下游动态</strong></p><p class="ql-align-justify">◎<strong>国务院：</strong>发布关于进一步做好稳就业工作的意见。意见指出，挖掘内需带动就业。鼓励汽车、家电、消费电子产品更新消费，有力有序推进老旧汽车报废更新，鼓励限购城市优化机动车限购管理措施。培育国内服务外包市场，支持行政事业单位、国有企业采购专业服务。</p><p class="ql-align-justify">◎<strong>杭州：</strong>富阳区举行杭州富春湾新城转型通报会暨项目集中签约活动。此次共有19个项目签约落地，涵盖智能制造、总部楼宇、双语学校、片区开发、金融服务等领域，总投资633亿元，总授信1250亿元。</p><p class="ql-align-justify">◎<strong>中新社：&nbsp;</strong>在中央经济工作会议重申“坚持房子是用来住的、不是用来炒的定位”后，12月23日召开的全国住房和城乡建设工作会议部署细节，明确将长期坚持这一定位。中国释放楼市调控稳定预期。</p><p class="ql-align-justify">◎<strong>社科院城市与竞争力研究中心主任：</strong>与2019年类似，明年商品房销售面积和销售额总体上将继续保持“年稳季变”的走势，销售额和销售面积增幅将保持在5%~10%和-1%~2%，所不同的是在相同季节走势可能略有不同。</p><p class="ql-align-justify">◎<strong>海关总署：</strong>2019年11月，我国出口空调240万台，同比下降34.7%；出口冰箱386万台，同比下降15.3%；出口洗衣机227万台，同比增长1.4%；出口彩电752万台，同比下降18.2%。2019年11月，我国进口空调1266台，同比下降37.9%；进口彩电566台，同比下降5.7%。</p><p class="ql-align-justify">◎<strong>中国证券报：</strong>12月23日，广汽集团和上汽集团签署战略合作框架协议。根据协议，双方将积极探讨在技术研发、资源协同、投资布局、市场拓展、商业模式创新及国际经营等相关领域开展合作。</p><p class="ql-align-justify">◎<strong>国际船舶网：</strong>根据克拉克森最新数据统计(截止2019年12月15日)，2019年11月份全球新签订单45艘，共计858644CGT。与2019年10月份全球新签订单58艘，共计1999591CGT相比较，数量环比下跌13艘，修正总吨环比下跌57.06%。</p><p class="ql-align-justify">（文章来源：我的钢铁网）</p><p><br></p>', '2019-12-25 09:49:34.681', '2019-12-25 09:49:34.681', '1', '陕西高级人民法院', '610000', '', '冯建伟1', NULL, NULL, 'admin', '2019-12-25 09:49:34.845', '2');
